import React , {Fragment} from "react";
import Header from "./components/Layout/Header";
import Meals from "./components/Meals/Meals";
import { YourCart } from "./components/yourCart/YourCart";

function App() {
  return (
    <Fragment>
      <Header/>
      <main>
          <Meals/>
      </main>
      <YourCart/>
    </Fragment>
  );
}

export default App;
